import React from 'react';
import {View, Text, TouchableOpacity} from 'react-native';

function Home(){
    return(
        <View>
            <Text>Hola Mundo!</Text>
        
        <TouchableOpacity onPress={console.log("me clickearon")}><Text>Boton</Text></TouchableOpacity>
        </View>
    )
}

export default Home
